#include<iostream>
#include <vector>

int main(){

    std::string str = "";
    // std::cout<<str;

    std::vector<std::string> ans;
    std::string temp = "";
    int count = 0;
    for(char c: str){
        temp.push_back(c);
        count++;
        if(count == 37){
            ans.push_back(temp);
            temp = "";
            count = 0;
        }
    }


    for(auto s : ans){
        std::cout<<s<<std::endl;
    }
    return 0;
}